sys_ui_script.script:
function onLoad() {
  // Load the UI Page
  var uiPage = new GlideappUiPage('todo_list_ui_page');
  uiPage.setPageID(current.sys_id);
  uiPage.setTitle('Todo List');
  uiPage.setPageClass('container');
  uiPage.setPageWidth(800);
  uiPage.addControl('JSInclude', 'jQuery');
  uiPage.render();
}

onLoad();
